    false,nt"url": null,nt"notes": " The primary legal divisions of most states
    are termed counties. In Louisiana, these divisions are known as parishes. In Alaska,
    whichn               has no counties, the equivalent entities are the organized
    boroughs, city and boroughs, municipalities, and for the unorganized area, census
    areas. Then               latter are delineated cooperatively for statistical purposes
    by the State of Alaska and the Census Bureau. In four states (Maryland, Missouri,
    Nevada,n               and Virginia), there are one or more incorporated places
    that are independent of any county organization and thus constitute primary divisions
    of theirn               states. These incorporated places are known as independent
    cities and are treated as equivalent entities for purposes of data presentation.
    The Districtn               of Columbia and Guam have no primary divisions, and
    each area is considered an equivalent entity for purposes of data presentation.
    The Census Bureaun               treats the following entities as equivalents of
    counties for purposes of data presentation: Municipios in Puerto Rico, Districts
    and Islands in Americann               Samoa, Municipalities in the Commonwealth
    of the Northern Mariana Islands, and Islands in the U.S. Virgin Islands. The entire
    area of the United States,n               Puerto Rico, and the Island Areas is covered
    by counties or equivalent entities. The boundaries for counties and equivalent entities
    are mostly as ofn               January 1, 2013, primarily as reported through the
    Census Bureau's Boundary and Annexation Survey (BAS). However, some changes made
    after January 2013,n               including the addition and deletion of counties,
